    function mimcMultiHash(uint[] memory arr) public returns (uint) {
        uint r = 0;
        for (uint i = 0; i < arr.length; i++) {
            // emit dGetBytes32(bytes32(r));
            r =
                (((r + mimc.MiMCpe7(arr[i] % prime, r)) % prime) +
                    (arr[i] % prime)) %
                prime;
        }
        return r;
